import homepic from '../assets/homepic.png'
import Mask from '../assets/mask-image.png'; // Replace with the path to your wave mask image
function Home() {

    const hometext = {
        fontFamily: 'ITC Franklin Gothic LT', 
        fontSize: '55px', 
        marginTop: '180px',
        marginLeft:'150px',
        whiteSpace: 'pre-line', // Allow line breaks
        fontWeight:'bold'
    };
    const homepicture = {
            width: '600px',
            height: '400px',
            WebkitMaskImage: `url(${waveMask})`, // WebKit browsers (Chrome, Safari)
            maskImage: `url(${waveMask})`, // Standard property
            maskSize: 'cover', // Adjust as needed
            marginTop: '50px',
            border: '15px solid #63821b',

      };
  return (
    <div className="home">
        <div style = {hometext}>Changing the Face of {'\n'}Irish Food Education</div>
        <div><img src={homepic} alt="homepic" style={homepicture} /></div>
    </div>

  )
}

export default Home
